import React from "react";

const Login = () => {
	return (
		<div className="login">
			<div className="login__image"></div>
			<div className="login__form">
				<div className="login__form__item">
					<div className="login__form__item__title"></div>
					<div className="login__form__item__content"></div>
				</div>
				<div className="login__form__item">
					<div className="login__form__item__title"></div>
					<div className="login__form__item__content"></div>
				</div>
        <div className="login__form__button"></div>
			</div>
		</div>
	);
};

export default Login;
